</SCRIPT><TABLE width="80%" align="center"><TR><TD align="left"><DIV class="dictionary"><H1><a href="ne" title="[36769] 2 ">ne</a></H1><SPAN><p><b>NE</b>, not, is obsolete.  We find it in early English writers, prefixed to other words; as nill, for ne will, will not; nas, for ne has, has not; nis for ne is, is not.</SPAN></DIV></TD></TR></TABLE><HR /><BR /><BR /><BR /><BR /><BR ><BR /><BR /><BR /><BR /><BR >
